INSERT INTO `about_us` (`id`, `section_type`, `heading`, `description`, `image`, `created_at`, `updated_at`) VALUES
(4, 'section-1', 'A DIGITAL COACHING PLATFORM', 'Set Goals, Honest approach, Accountability partner, Simple Solutions, Action Plan, Support', '202208300710digital.png', '2022-08-30 04:51:00', '2022-08-30 09:37:56'),
(5, 'section-2', 'All you need is:', '<p class=\"MsoNormal\"><span style=\"font-size:14.0pt;mso-bidi-font-size:10.0pt;\nline-height:115%\">access to the internet and data for the sessions, 1.5 hours a\nweek for the next 3 months.</span><span style=\"font-size:9.0pt;\nmso-bidi-font-size:11.0pt;line-height:115%\"><o:p></o:p></span></p>', '', '2022-08-30 06:37:55', '2022-08-30 11:24:27'),
(6, 'section-3', 'What does this mean', '<ul type=\"disc\">\r\n <li class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial, sans-serif\">a</font></li></ul>', '', '2022-08-30 06:37:55', '2022-09-12 11:31:33'),
(7, 'section-4', '', '{\"0\":{\"heading\":\"What does this mean\",\"content\":\"<ul type=\\\"disc\\\"><li class=\\\"MsoNormal\\\" style=\\\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\"><span style=\\\"font-family: Arial; font-size: 1rem;\\\">Peoples\\r\\n     everyday lives will be better<\\/span><br><\\/li><li class=\\\"MsoNormal\\\" style=\\\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\"><span style=\\\"font-family: Arial;\\\">Money\\r\\n     becomes an enabler of goals and dreams<\\/span><\\/li><li class=\\\"MsoNormal\\\" style=\\\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\"><span style=\\\"font-family: Arial;\\\">Less\\r\\n     debt and more money to spend on the things that REALLY matter to you and\\r\\n     your family<\\/span><\\/li><li class=\\\"MsoNormal\\\" style=\\\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\"><span style=\\\"font-family: Arial;\\\">Organisations\\r\\n     who have focused employees who are able to be the best they can be<\\/span><\\/li><li class=\\\"MsoNormal\\\" style=\\\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\"><span style=\\\"font-family: Arial;\\\">Creating\\r\\n     good role models for future generations<\\/span><\\/li><\\/ul><p class=\\\"MsoNormal\\\" style=\\\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\\\"><span style=\\\"font-family: Arial, &quot;sans-serif&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\">We believe that everyone has the potential to be a good money manager.<o:p><\\/o:p><\\/span><\\/p><p class=\\\"MsoNormal\\\" style=\\\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: normal;\\\"><span style=\\\"font-family: Arial, &quot;sans-serif&quot;; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\">We know that there is an abundance of financial wellness and education programs in the market. However, we also know that more and more people are financially stressed and something is not working.<\\/span><\\/p>\"},\"3\":{\"heading\":\"We are Different\",\"content\":\"<p><span style=\\\"font-family: Arial, &quot;sans-serif&quot;;\\\">We focus on action and outcomes. We drive real sustainable change. We focus on what success looks like for you. We make it simple. We will support and empower you to build and own your money management capabilities<\\/span><br><\\/p>\"},\"4\":{\"heading\":\"How do we do this\",\"content\":\"<p>We offer a digital coaching platform, where YOU define your journey and we provide the road map and tools to take some of the bumps out of the road. No long workshops. Bite sized information with action plans that are real and focus on your goals. We are your accountability partner and your sounding board throughout.<br><\\/p>\"}}', '', '2022-08-29 09:22:21', '2023-04-21 10:20:11');
