(3, 'cookie-policy', '<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:30.0pt;font-family:&quot;inherit&quot;,&quot;serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;\ncolor:black;mso-font-kerning:18.0pt\">COOKIE POLICY</span></b><b><span style=\"font-size:30.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\n&quot;Times New Roman&quot;;color:black;mso-font-kerning:18.0pt\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><i><span style=\"font-size:10.5pt;font-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-font-kerning:0pt\">This\nCookie Policy was last updated on May5, 2023 and applies to citizens and legal\npermanent residents of South Africa.</span></i><span style=\"font-size:10.5pt;\nfont-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-font-kerning:0pt\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 11.25pt 0in 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:16.5pt;font-family:&quot;var(--fontFamily)&quot;,&quot;serif&quot;;mso-fareast-font-family:\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Segoe UI&quot;;color:black;mso-font-kerning:\n0pt\">1. Introduction<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-font-kerning:0pt\">Our\nwebsite,&nbsp;</span><a href=\"http://heycoach.co.za/\"><span style=\"font-size:\n10.5pt;font-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-font-kerning:0pt\">http://heycoach.co.za</span></a><span style=\"font-size:\n10.5pt;font-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-font-kerning:0pt\">&nbsp;(hereinafter: “the website”) uses\ncookies and other related technologies (for convenience all technologies are\nreferred to as “cookies”). Cookies are also placed by third parties we have\nengaged. In the document below we inform you about the use of cookies on our\nwebsite.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 11.25pt 0in 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:16.5pt;font-family:&quot;var(--fontFamily)&quot;,&quot;serif&quot;;mso-fareast-font-family:\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Segoe UI&quot;;color:black;mso-font-kerning:\n0pt\">2. What are cookies?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-font-kerning:0pt\">A\ncookie is a small simple file that is sent along with pages of this website and\nstored by your browser on the hard drive of your computer or another device.\nThe information stored therein may be returned to our servers or to the servers\nof the relevant third parties during a subsequent visit.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 11.25pt 0in 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:16.5pt;font-family:&quot;var(--fontFamily)&quot;,&quot;serif&quot;;mso-fareast-font-family:\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Segoe UI&quot;;color:black;mso-font-kerning:\n0pt\">3. What are scripts?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-font-kerning:0pt\">A\nscript is a piece of program code that is used to make our website function\nproperly and interactively. This code is executed on our server or on your\ndevice.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 11.25pt 0in 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:16.5pt;font-family:&quot;var(--fontFamily)&quot;,&quot;serif&quot;;mso-fareast-font-family:\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Segoe UI&quot;;color:black;mso-font-kerning:\n0pt\">4. What is a web beacon?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-font-kerning:0pt\">A\nweb beacon (or a pixel tag) is a small, invisible piece of text or image on a\nwebsite that is used to monitor traffic on a website. In order to do this,\nvarious data about you is stored using web beacons.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 11.25pt 0in 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:16.5pt;font-family:&quot;var(--fontFamily)&quot;,&quot;serif&quot;;mso-fareast-font-family:\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Segoe UI&quot;;color:black;mso-font-kerning:\n0pt\">5. Cookies<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-top: 18.75pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:10.5pt;\nfont-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-font-kerning:0pt\">5.1 Technical or functional cookies<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-font-kerning:0pt\">Some\ncookies ensure that certain parts of the website work properly and that your\nuser preferences remain known. By placing functional cookies, we make it easier\nfor you to visit our website. This way, you do not need to repeatedly enter the\nsame information when visiting our website and, for example, the items remain\nin your shopping cart until you have paid. We may place these cookies without\nyour consent.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-top: 18.75pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:10.5pt;\nfont-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-font-kerning:0pt\">5.2 Marketing/Tracking cookies<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Segoe UI&quot;,&quot;sans-serif&quot;;\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-font-kerning:0pt\">Marketing/Tracking\ncookies are cookies or any other form of local storage, used to create user\nprofiles to display advertising or to track the user on this website or across\nseveral websites for similar marketing purposes.<o:p></o:p></span></p><p class=\"MsoN